import "./Selection.css";
import Button from "./Button";

const Selection = () => {
    return (
        <div className = "Selection">
            <div><Button text="이게 맵다고?"/></div>
            <div><Button text="딱 맛있게 맵다"/></div>
            <div><Button text="좀 맵지만 먹을 수는 있다"/></div>
            <div><Button text="도전이었다"/></div>
            <div><Button text="다시는 못 먹을 매운맛!! ㅠ"/></div>
        </div>
    );
}

export default Selection;
